},
{
    country:'INDIA',
    state: 'KA' 
}]);
  return (
    <div className="App">
      <header className="App-header">
      <div className="data-container">
      <div>
      <button> Click me </button>
      <ul>
        {data.map((item,index) =>
<li key={index}>{item.country}- {item.state}</li>
)}
